import React from "react";
import styled from "styled-components";
import { FiCamera } from "react-icons/fi";
import { BsList } from "react-icons/bs";
import GlobalStyle from "./GlobalStyle";


const ExampleText = styled.p`
    font-size: 50px;
  font-weight: 200;
  text-align: center;
  margin-top: 130px;
`
const ExampleContent = styled.p`
    font-size: 25px;
  font-weight: 100;
  text-align: center;
  margin-top: 10px;
  line-height: 40px;
  color: gray;
`
const ExampleButton1 = styled.div`
    width: 207px;
  height: 50px;
  border-radius:5px;
  background-color:#007bff;
  margin-left: 740px;
  margin-top: 30px;
`
const ButtonText1 = styled.p`
    color: white;
    font-size: 21px;
  font-weight: 500;
  position:absolute;
  margin-top: 10px;
  margin-left: 17px;
`
const ExampleButton2 = styled.div`
    width: 207px;
  height: 50px;
  border-radius:5px;
  background-color:#6c757d;
  margin-left: 953px;
  margin-top: -50px;
`
const ButtonText2 = styled.p`
    color: white;
    font-size: 21px;
  font-weight: 500;
  position:absolute;
  margin-top: 10px;
  margin-left: 18px;
`
const Box = styled.div`
    display:inline-block;
    flex-direction: row;
`
const TopBar= styled.div`
    width: 100%;
    height: 85px;
    background-color: #343a40;
    margin-top: -10px;
    
`
const Camera = styled(FiCamera)`
  margin-left: 210px;
  margin-top: 35px;
  position: absolute;
`
const List = styled(BsList)`
  margin-left: 1620px;
  margin-top: 20px;
  position: relative;
`

const BarText = styled.p`
    color: white;
    font-size: 27px;
    font-weight: 1000;
    margin-top: -45px;
    margin-left: 247px;
`

const Example = (props) =>{
    return(
        <>
        <GlobalStyle/>
        <TopBar>
        <Camera size="27" color="white"/>
        <List size="55" color="blue"/>
        <BarText>Album</BarText>
        </TopBar>
        <ExampleText>{props.exampleText}</ExampleText>
        <ExampleContent>Something short and leading
        about the collection below—its contents, <br/> the creator, etc. 
        Make it short and sweet, but not too short so folks don’t<br/> simply skip over it entirely.</ExampleContent>
        <Box>
            <ExampleButton1>
            <ButtonText1>Main call to action</ButtonText1>
            </ExampleButton1>
        <ExampleButton2>
            <ButtonText2>Secondary action</ButtonText2>
            </ExampleButton2>
        </Box>
        </>
    )
}

export default Example;
